import React from "react";
import "./style.css";
import Search from "../../svg/Search";
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <div className="header">
      <div className="search">
        <input type="text" placeholder="Search" />
        <button>
          <Search></Search>
        </button>
      </div>
      <div className="header_items">
        <Link to="/" className="item item">
          Home
        </Link>
        <Link className="item hover2">Products</Link>
        <Link className="item hover2">Contact</Link>
        <Link className="item hover2">Log In</Link>
        <Link className="item hover2">Sign Up</Link>
        <Link className="item hover2">Cart</Link>
      </div>
    </div>
  );
}
